function largestOfFour(arr) {
  let largestNums = [];
  let biggestNum = -10000;
  for(let i = 0; i < arr.length; i++) {
    biggestNum = -10000;
    for(let j = 0; j < arr[i].length; j++) {
      if(arr[i][j] > biggestNum) {
        biggestNum = arr[i][j];
      }
    }
    console.log("biggestNum: " + biggestNum);
    largestNums.push(biggestNum);
  }
  return largestNums;
}

